import React, { useState } from 'react';
import './Admin.css';

export default function Admin(){
  const [tab, setTab] = useState('users');

  return (
    <div className="admin-page">
      <div className="admin-header">
        <div className="container">
          <h1>Admin Dashboard</h1>
          <p className="muted">Manage users, bookings, flights and support tickets.</p>
        </div>
      </div>

      <div className="container">
        <div className="admin-tabs">
          {['users','bookings','airlines','extras'].map(t=> (
            <button key={t} className={`admin-tab ${tab===t? 'active':''}`} onClick={() => setTab(t)}>{t}</button>
          ))}
        </div>

        <div className="admin-body">
          {tab==='users' && <div className="admin-card">Users management coming soon</div>}
          {tab==='bookings' && <div className="admin-card">Bookings management coming soon</div>}
          {tab==='airlines' && <div className="admin-card">Airlines and flights coming soon</div>}
          {tab==='extras' && <div className="admin-card">Support & statistics coming soon</div>}
        </div>
      </div>
    </div>
  )
}
